import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ProShopOrderDetails.css';

function ProShopOrderDetails() {
  const navigate = useNavigate();
  const [tip, setTip] = useState('');
  const [userLocation, setUserLocation] = useState('');
  const [wearing, setWearing] = useState('');
  const [instructions, setInstructions] = useState('');
  const [locationError, setLocationError] = useState(false);

  // Fixed values for demo
  const orderItems = [
    { name: "Titleist Pro V1 Golf Balls (Dozen)", price: 49.99 },
    { name: "Wooden Tees (Pack of 50)", price: 5.99 },
    { name: "Dobson Ranch Logo Golf Glove", price: 19.99 }
  ];

  const subtotal = 75.97;
  const taxRate = 0.086;
  const deliveryFee = 2.00;
  
  // Calculate tax
  const salesTax = subtotal * taxRate;
  
  // Calculate total
  const total = subtotal + salesTax + deliveryFee + (parseFloat(tip) || 0);

  const handleTipChange = (e) => {
    const value = e.target.value.replace(/[^\d.]/g, '');
    if (value.split('.').length > 2) return;
    if (value.split('.')[1]?.length > 2) return;
    setTip(value);
  };

  const handleShareLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setUserLocation(`Lat: ${position.coords.latitude}, Long: ${position.coords.longitude}`);
        },
        (error) => {
          console.error("Error getting location:", error);
        }
      );
    }
  };

  const handlePlaceOrder = () => {
    if (!userLocation.trim()) {
      setLocationError(true);
      return;
    }
    
    // Navigate to the existing confirmation page
    navigate('/order-confirmation');
  };

  return (
    <div className="order-details-page">
      <h1>Pro Shop Order</h1>
      <p className="subtitle">Give us your location below, and we'll bring your order asap.</p>

      <div className="order-details-container">
        <div className="section-label">Your Order:</div>
        
        {orderItems.map((item, index) => (
          <div key={index} className="order-item">
            <span>{item.name}</span>
            <span>${item.price.toFixed(2)}</span>
          </div>
        ))}

        <div className="order-item subtotal">
          <span>Subtotal</span>
          <span>${subtotal.toFixed(2)}</span>
        </div>

        <div className="order-item">
          <span>Sales Tax (8.6%)</span>
          <span>${salesTax.toFixed(2)}</span>
        </div>

        <div className="order-item">
          <span>Delivery Fee</span>
          <span>${deliveryFee.toFixed(2)}</span>
        </div>

        <div className="order-item tip-section">
          <span className="tip-label">Tip:</span>
          <div className="tip-input-wrapper">
            <input
              type="text"
              placeholder="Enter tip amount"
              value={tip}
              onChange={handleTipChange}
              className="tip-input"
            />
          </div>
        </div>

        <div className="order-item total">
          <span>Total</span>
          <span>${total.toFixed(2)}</span>
        </div>

        <div className="section-label">
          Your Location: <span className="required">*</span>
        </div>
        <div className="location-input-group">
          <input
            type="text"
            placeholder="e.g., Hole 7, near the bunker"
            value={userLocation}
            onChange={(e) => {
              setUserLocation(e.target.value);
              if (locationError) setLocationError(false);
            }}
            className={`location-input ${locationError ? 'error' : ''}`}
            required
          />
          <button onClick={handleShareLocation} className="share-location-btn">
            üìçShare my location
          </button>
        </div>
        {locationError && (
          <div className="error-message">Please enter your location</div>
        )}

        <div className="section-label">What You're Wearing:</div>
        <input
          type="text"
          placeholder="e.g., Red shirt, khaki shorts"
          value={wearing}
          onChange={(e) => setWearing(e.target.value)}
        />
      </div>

      <button 
        className="place-order-btn"
        onClick={handlePlaceOrder}
        disabled={!userLocation.trim()}
      >
        Place Order
      </button>
    </div>
  );
}

export default ProShopOrderDetails;
